  false,\n\t\"url\": null,\n\t\"notes\": \"This is a simplified (aka generalized or
  smoothed) version of the detailed Large Scale International Boundaries (LSIB) dataset.
  This dataset included simplified LSIB polygons for Eurasia & Oceania.  This dataset
  also matches the simplified LSIB lines.nnThe simplified boundary lines reflect all
  current US government policies on boundaries, boundary disputes, and sovereignty.
  This dataset excludes medium and smaller islands. These islands, plus two and three-digit
  ISO codes, can be found in the full resolution LSIB polygon dataset. These files
  utilize the World Vector Shoreline (WVS) coastline data from NGA. WVS is outdated
  and often shifted by several hundred meters to over a km.nnThere are no restrictions
  on use of this public domain data. This dataset will be updated as needed and is
  current as of January 23, 2015. nnThis dataset is hosted on State GeoNode at http://geonode.state.gov/layers/geonode%3AEurasiaOceania_LSIB_Polygons_Simplified_2015.\",\n\t\"owner_org\":
